import React from 'react';
import { CFooter, CLink } from '@coreui/react';
import { FaLinkedin, FaGithub } from 'react-icons/fa';

const Footer = () => {
    return (
        <CFooter className="d-flex flex-row justify-content-center align-items-center list-unstyled bg-dark">
            <div style={{ display: 'flex', justifyContent: 'center' }}>
                <CLink href="https://www.linkedin.com/" target="_blank" style={{ margin: '0 10px' }}>
                    <FaLinkedin />
                </CLink>
                <CLink href="https://github.com/" target="_blank" style={{ margin: '0 10px' }}>
                    <FaGithub />
                </CLink>
            </div>
        </CFooter>
    );
};

export default Footer;
